import React from 'react';
import { motion } from 'framer-motion';
import { 
  WifiIcon,
  TruckIcon,
  SparklesIcon,
  HeartIcon,
  FireIcon,
  ShieldCheckIcon,
  MapPinIcon,
  ClockIcon
} from '@heroicons/react/24/outline';

const AmenitiesSection = () => {
  const amenities = [
    {
      id: 1,
      name: 'WiFi Gratuit',
      description: 'Conectare internet de mare viteză în toate zonele hotelului',
      icon: WifiIcon,
      color: 'text-blue-500'
    },
    {
      id: 2,
      name: 'Parcare Privată',
      description: 'Parcare securizată și gratuită pentru toți oaspeții',
      icon: TruckIcon,
      color: 'text-green-500'
    },
    {
      id: 3,
      name: 'Spa & Wellness',
      description: 'Centru spa complet cu saună, jacuzzi și tratamente relaxante',
      icon: SparklesIcon,
      color: 'text-purple-500'
    },
    {
      id: 4,
      name: 'Restaurant Gourmet',
      description: 'Restaurant cu bucătărie tradițională românească și internațională',
      icon: HeartIcon,
      color: 'text-red-500'
    },
    {
      id: 5,
      name: 'Sala de Fitness',
      description: 'Sala modernă cu echipamente de ultimă generație',
      icon: FireIcon,
      color: 'text-orange-500'
    },
    {
      id: 6,
      name: 'Securitate 24/7',
      description: 'Sistem de securitate avansat și personal de pază',
      icon: ShieldCheckIcon,
      color: 'text-indigo-500'
    },
    {
      id: 7,
      name: 'Locație Centrală',
      description: 'Poziționat perfect în centrul Sinaiei, lângă principalele atracții',
      icon: MapPinIcon,
      color: 'text-teal-500'
    },
    {
      id: 8,
      name: 'Recepție 24/7',
      description: 'Servicii de recepție disponibile non-stop pentru asistență',
      icon: ClockIcon,
      color: 'text-cyan-500'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section id="amenities" className="section-padding bg-white">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            Facilitățile Noastre
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Descoperă toate facilitățile pe care le oferim pentru a-ți face șederea 
            cât mai confortabilă și memorabilă.
          </p>
        </motion.div>

        {/* Amenities Grid */}
        <motion.div
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6"
        >
          {amenities.map((amenity) => {
            const IconComponent = amenity.icon;
            return (
              <motion.div
                key={amenity.id}
                variants={itemVariants}
                className="group p-6 bg-gray-50 hover:bg-white hover:shadow-lg transition-all duration-300 border border-transparent hover:border-gray-200"
              >
                <div className="flex flex-col items-center text-center">
                  {/* Icon */}
                  <div className={`w-12 h-12 bg-white shadow-sm flex items-center justify-center mb-4 group-hover:scale-110 transition-transform duration-300 ${amenity.color}`}>
                    <IconComponent className="w-6 h-6" />
                  </div>

                  {/* Content */}
                  <h3 className="font-display font-semibold text-text-primary mb-2">
                    {amenity.name}
                  </h3>
                  <p className="text-sm text-text-light leading-relaxed">
                    {amenity.description}
                  </p>
                </div>
              </motion.div>
            );
          })}
        </motion.div>

        {/* Additional Info */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          className="mt-16 bg-gradient-to-r from-primary-50 to-warm-50 p-8 md:p-12"
        >
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8 items-center">
            <div>
              <h3 className="text-2xl md:text-3xl font-display font-bold text-text-primary mb-4">
                Experiență Completă
              </h3>
              <p className="text-text-light mb-6 leading-relaxed">
                La Hotel Marami, ne concentrăm pe fiecare detaliu pentru a-ți oferi o experiență 
                de cazare excepțională. De la facilitățile moderne până la serviciile personalizate, 
                totul este gândit pentru confortul și satisfacția ta.
              </p>
              <div className="space-y-3">
                <div className="flex items-center space-x-3">
                  <div className="w-2 h-2 bg-primary-500"></div>
                  <span className="text-text-secondary">Acces gratuit la toate facilitățile</span>
                </div>
                <div className="flex items-center space-x-3">
                  <div className="w-2 h-2 bg-primary-500"></div>
                  <span className="text-text-secondary">Personal dedicat și prietenos</span>
                </div>
                <div className="flex items-center space-x-3">
                  <div className="w-2 h-2 bg-primary-500"></div>
                  <span className="text-text-secondary">Standarde de igienă excepționale</span>
                </div>
              </div>
            </div>
            <div className="relative">
              <img
                src="https://images.unsplash.com/photo-1551882547-ff40c63fe5fa?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80"
                alt="Facilități Hotel Marami"
                className="shadow-lg"
                loading="lazy"
              />
              <div className="absolute inset-0 bg-gradient-to-t from-black/20 to-transparent"></div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default AmenitiesSection;
